content:
선생님이 건이 혼낼때 칠판에
&quot;내 심장의 색깔은 블랙&quot;
작가님 블밍아웃ㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ

보는 내내 &#x27;설마....설마....에이...설마....&#x27;
쒯 
우리 작가님 스토리 진행 상남자 노빠꾸 이시다 ㄷㄷㄷㄷ

1부에서 추승룡
들깨 들어가면 술이 들깨 으하하하하하

2부 : 세계관 최강자;;;

1.대낮에 조폭 수명이 제복 경찰관 폭행...&quot;무너진 공권력.&quot;
2.조폭 조직원 추정 남성 파출소 앞에서 흉기들고 난동...&quot;엄중 처벌해야&quot;
3.경찰청장 오늘 긴급 성명, &quot;공권력 우롱한 조폭, 대한민국에서 뿌리 뽑을것.&quot;
4.광역수사대 &#x27;비상&#x27; 해당 조폭 조직원 신원 확보 및 검거에 주력
5.ㅇㅇ지방검찰청 강력부, &quot;경찰과 합동수사 진행 예정.&quot;
6.경찰 폭행했던 조폭 &#x27;시공파&#x27; 소속 조직원으로 밝혀져
7.10시간여 걸친 시공파 조직원 검거작전, 동원된 경찰력만 수백...&quot;관할서 광역수사대, 강력계 형사 전부 동원.&quot;

만화는 만화니까 그러려니 하며 보는데...
애들이 세상이 진짜 이런줄 알까봐 걱정이 ...
공권력이 너무 우습게 표현되니....ㅡㅡ;

근데 늘 공고생들이 깨지냐;; 쟤들은 공부도 못하는데..싸움이라도 잘해야지;;
워째 늘 공고애들 나쁜역할 맡고...
늘 인문계 애들이 더 주먹이 쎄냐구...

설사를 왜 저렇게 표현하시는지..;;
건설사 소속 사람이 저런 건달이겠습니까..
단지 몇몇 건설사에서 용역업체를 쓰는거죠

노가장이 사문비기 뒷부분 생각안나는게 박치기 훈련하다가
부분기억상실증 걸렸다고해도 ㅇㅈ할정도의 박치기다;;
저정도 박치기면 제자가 없는게 아니라 있는데 기억 안나거나 무공 전수받았는데 기억날라가서 평범하게 살고있는거 아니냐 ㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ박치기 ㅈㄴ터프하네 ㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ

&lt;질문&gt;
검도문과는 왜 싸운건가요?
그 배경이 궁금합니다.
